import React, { Component } from 'react';
import './component.css';

class Footer extends Component {

    render(){
        return(
            <div className='footer'>
                <div className='footer-line'>
                    Reach to us!
                </div>
                <div className='footer-contact'>
                    <div className='f1'>
                    We are a team of passionate people whose goal is to
                     improve everyone's life through disruptive products. 
                     We build great products to solve your business 
                     problems. Our products are designed for small to large scale companies willing to optimize their performance.
                    </div>
                    <div className='f2'></div>
                </div>
            </div>
        );
    }
}

export default Footer;
